import React from 'react';
import './App.css';
import { PlantList } from './datas/PlantList';
export default function App() {
  return (
    <div>
        <div id='bnr'><img src='assets/logo.png' id='imglogo'/><span id='logo'>La maison jungle</span></div>
        <hr/>
        {PlantList[0].name}
    </div>
  )
}
